function round(num, decimals) {
    return +(Math.round(num + "e+" + decimals) + "e-" + decimals);
}

var unit = env.get("Unit");
if (unit.length == 0) {return msg;}
if (unit == "€"){unit = "kWh";}

if (env.get("Input unit") || msg.houseUnit || msg.solarUnit || msg.fromGridUnit || msg.toGridUnit)
{
