        msg.solarUnit = unit;
    }
    if (Number.isFinite(msg.fromGrid)) {
        var fromGridInputUnit = msg.fromGridUnit ? msg.fromGridUnit : env.get("Input unit");
        msg.fromGrid = unitConvert(msg.fromGrid, fromGridInputUnit, unit);
        msg.fromGridUnit = unit;
    }
    if (Number.isFinite(msg.toGrid)) {
        var toGridInputUnit = msg.toGridUnit ? msg.toGridUnit : env.get("Input unit");
        msg.toGrid = unitConvert(msg.toGrid, toGridInputUnit, unit);
        msg.toGridUnit = unit;
    } 
}
return msg;

function unitConvert(num, inputUnit, outputUnit) {
    if (inputUnit == outputUnit){return num;}

    if(inputUnit == "W")
    {
        if (outputUnit == "kW") {return powerOfTen(num, -3);}
        else {node.error("can't convert " + inputUnit + " to " + outputUnit);}
    }

    if (inputUnit == "kW") 
    {
        if (outputUnit == "W") {return powerOfTen(num, 3);}
        else {node.error("can't convert " + inputUnit + " to " + outputUnit);}
    }

    if (inputUnit == "Wh")
    {
        if (outputUnit == "kWh") {return powerOfTen(num, -3);}
        else if (outputUnit == "MWh") {return powerOfTen(num, -6);}
        else {node.error("can't convert " + inputUnit + " to " + outputUnit);}
    }

    if (inputUnit == "kWh") {
        if (outputUnit == "Wh") {return powerOfTen(num, 3);}
        else if (outputUnit == "MWh") {return powerOfTen(num, -3);}
        else {node.error("can't convert " + inputUnit + " to " + outputUnit);}
    }

    if (inputUnit == "MWh") {
        if (outputUnit == "Wh") {return powerOfTen(num, 6);}
        else if (outputUnit == "kWh") {return powerOfTen(num, 3);}
        else {node.error("can't convert " + inputUnit + " to " + outputUnit);}
    }
}

function powerOfTen(num, po10) {
    return +(num + "e" + po10);
}

